import utm


def convert_to_latlon(best_path):
    converted = []
    for i in range(len(best_path)):
        best_path[i][0] = best_path[i][0] / 100
        best_path[i][1] = best_path[i][1] / 100
        converted.append(utm.to_latlon(best_path[i][0], best_path[i][1], 18, 'U'))
    return converted

